import React from 'react';
import { Container, Row, Col, Button, Nav } from 'react-bootstrap';
import { Link, Route, Routes } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css'; // Importa tu archivo de estilos

// Importa tus componentes de página
import HomePage from './pages/HomePage';
import CitasPage from './pages/CitasPage';
import ServiciosPage from './pages/ServiciosPage';
import AboutPage from './pages/AboutPage'; // Asegúrate de crear estas páginas

const App = () => {
  return (
    <Container fluid>
      <Row>
        <Col md={2} className="sidebar">
          <Nav className="flex-column">
            <Nav.Link as={Link} to="/">Inicio</Nav.Link>
            <Nav.Link as={Link} to="/servicios">Servicios</Nav.Link>
            <Nav.Link as={Link} to="/citas">Citas</Nav.Link>
            <Nav.Link as={Link} to="/about">Sobre Nosotros</Nav.Link>
            <Nav.Link as={Link} to="/contact">Contacto</Nav.Link>
          </Nav>
        </Col>
        <Col md={10} className="main-content">
          <div className="hero-section">
            <h1>JR.JR PETS</h1>
            <Link to="/about">
              <img src="/images/descarga.png" alt="Logo" className="hero-image" />
            </Link>
          </div>
          <div className="buttons-section">
            <Button as={Link} to="/servicios" variant="primary">Nuestros Servicios</Button>
            <Button as={Link} to="/citas" variant="secondary">Hacer Cita</Button>
          </div>
          <Routes>
            <Route path="/" element={<HomePage />} />
            <Route path="/servicios" element={<ServiciosPage />} />
            <Route path="/citas" element={<CitasPage />} />
            <Route path="/about" element={<AboutPage />} />
            {/* Agrega más rutas según sea necesario */}
          </Routes>
        </Col>
      </Row>
    </Container>
  );
};

export default App;
